import './video.css'


function Video(){
    return(
        <>
        <img className='photo' alt='image' src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.istockphoto.com%2Fphotos%2Fnature&psig=AOvVaw1DW7SfCLjcESN1_OjB9XgJ&ust=1679033079409000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCJCLy-Pj3_0CFQAAAAAdAAAAABAE'></img>
        <div>Video</div>
        </>
    )
}



export default Video;
